$lookup Array of Objects in parent Array and append the results to each item of said Array<p>Considering the following document "Backpack", each <code>slots</code> is a piece of said backpack, and each slot has a <code>contents</code> describing various items and a count of them. </p>

<pre><code>    {
        _id: "backpack",
        slots: [
            {
                slot: "left-pocket",
                contents: [
                    {
                        item: "pen",
                        count: 3
                    },
                    {
                        item: "pencil",
                        count: 2
                    },
                ]
            },
            {
                slot: "right-pocket",
                contents: [
                    {
                        item: "bottle",
                        count: 1
                    },
                    {
                        item: "eraser",
                        count: 1
                    },
                ]
            }
        ]
    }
</code></pre>

<p>The <code>item</code> field is the <code>_id</code> of an item of another collection, e.g.:</p>

<pre><code>    {
        _id: "pen",
        color: "red"
        (...)
    },
</code></pre>

<p>Same for pen, pencil, bottle, eraser, etc.</p>

<p>I want to make a <code>$lookup</code> so I can fill in the item's data, but I'm not finding a way of having the lookup's <code>as</code> be the same place as the item. That is:</p>

<pre><code>    db.collection.aggregate({
        {
            $lookup: {
                from: 'items',
                localField: 'slots.contents.item',
                foreignField: '_id',
                as: 'convertedItems', // &lt;=== ISSUE
            },
        },
    })
</code></pre>

<p>Problem is that <code>as</code> being named <code>convertedItems</code> means the document gets an array of items in the root of the document called 'convertedItems', like this:</p>

<pre><code>{
    _id: "backpack",
    slots: [ (...) ],
    convertedItems: [ (...) ]
}
</code></pre>

<p><strong>How can I tell <code>$lookup</code> to actually use the <code>localField</code> as the place to append the data?</strong></p>

<p>That is, make document become:</p>

<pre><code>{
    _id: "backpack",
    slots: [
        {
            slot: "left-pocket",
            contents: [
                {
                    item: "pen", // &lt;== NOTE
                    count: 3, // &lt;== NOTE
                    _id: "pen",
                    color: "red"
                    (...)
                },
                {
                    item: "pencil", // &lt;== NOTE
                    count: 2, // &lt;== NOTE
                    _id: "pencil",
                    color: "blue"
                    (...)
                },
            ]
        },
    (...)
</code></pre>

<p><em>Note:</em> At this point, if have entire data of item, doesn't matter if <code>item</code> property is kept, but <code>count</code> must remain.</p>

<p>I can't manually do <code>$addFields</code> with <code>arrayElemAt</code> because the number of items in <code>slots</code> is not fixed.</p>

<hr>

<p>Extra Info: I'm using MongoAtlas Free so assume MongoDB 4.2+ (no need to unwind arrays for $lookup).</p>

<hr>

<p>PS: I thought now of just leaving as root item (e.g. "convertedItems") and on the code that receives the API, when looping through the items, I do Array.find on the "convertedItems" per the the _id using the item. <em>I'll keep the question as I'm curious on how to do on MongoDB side</em></p>

