mongoose save multi level nested objects<p>I try to implement my first mongoose based REST API.</p>

<p>I tried now for days but cannot get this up and running. I would like to save the survey with an array of controls and for each control an array of controlProperties.</p>

<p>In different scenarios I got it to save survey with controls array but without controlProperties and sometime with not even controls array.</p>

<p>Can someone please help me understand my error?</p>

<p>Thanks a lot.</p>

<p>The structure is as follows:</p>

<p>Survey
    -- Array of control
        -- Array of controlProperty</p>

