How do I update a MongoDB document with new value using reactors Mono? (Kotlin)<p>So the context is that I require to update a value in a single document, I have a <strong>Mono</strong>, the parameter Object contains values such as <em>username</em> (to find the correct user by unique username) and an <em>amount</em> value. </p>

<p>The problem is that this value (due to other components of my application) is the value by which I need to increase/decrease the users balance, as opposed to passing a new balance. I intend to do this using two <strong>Monos</strong> where one finds the user, then this is combined to the other <strong>Mono</strong> with the inbound request, where I can then perform a simple sum (i.e balance + <strong>changeRequest</strong>.amount) then return this to the document database.</p>

<pre><code>override fun increaseBalance(changeRequest: Mono&lt;ChangeBalanceRequestResource&gt;): Mono&lt;ChangeBalanceResponse&gt; {

    val changeAmount: Mono&lt;Decimal128&gt; = changeRequest.map { it.transactionAmount }

    val user: Mono&lt;User&gt; = changeRequest.flatMap { rxUserRepository.findByUsername(it.username)


    val newBalace = user.map {
        val r = changeAmount.block()
        it.balance = sumBalance(it.balance!!, r!!)
            rxUserRepository.save(it)
    }
    .flatMap { it }
    .map { it.balance!! }

    return Mono.just(ChangeBalanceResponse("success", newBalace.block()!!))
 }
</code></pre>

<p>Obviously I'm trying to achieve this in a non-blocking fashion. I'm also open to using only a single Mono if that's possible/optimal. I also appreciate I've truly butchered the example and used .block as a placeholder to illustrate what I'm trying to achieve.</p>

<p>P.S this is my first post, so any tips on how to express my problem clearer would be useful.</p>

